--
-- Table structure for table `visitors`
--

DROP TABLE IF EXISTS `visitors`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `visitors` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `users_id` bigint(20) unsigned NOT NULL,
  `check_in` datetime DEFAULT NULL COMMENT 'День заселения',
  `check_out` datetime DEFAULT NULL COMMENT 'Выезд',
  PRIMARY KEY (`id`),
  KEY `visitors_check_in_check_out_idx` (`check_in`,`check_out`),
  KEY `users_id` (`users_id`),
  CONSTRAINT `visitors_ibfk_1` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

